import React, {Component} from 'react';

class Navbar extends Component{
    render(){
        return(
            <nav className="navbar navbar-dark bg-secondary">
                <h4 className="navbar-brand">Customer Order Information</h4>
            </nav>
        );
    }
}

export default Navbar;
